        html: "<p>Thanks for replying digiplay! I also missed you, I'm your biggest\
          \ fan! I was even worried you had quit because you got bored, I'm glad to\
          \ know you'll be back when you're healthy!</p>\n<p>OldFish 1.1 is my favorite\
          \ anime model, it doesn't even look AI generated, I've been trying to fix\
          \ it in the way you did, and even managed to make merges that are 1.0 OldFish\
          \ and 0.0 the other model (then the other model doesn't matter and I always\
          \ get the same outcome), but after everything is said and done, it never\
          \ produces the same images! I suspect that what timevisitor did was bake\
          \ in a VAE, in a way where the model is able to produce those sharp and\
          \ colorful results without one, and then REMOVED it, to save space, because,\
          \ the models draws as if it had it, you don't need a VAE at all. But then\
          \ trying to fix it by adding a VAE... just, let me show you:</p>\n<p><a\
          \ rel=\"nofollow\" href=\"https://cdn-uploads.huggingface.co/production/uploads/63239b8370edc53f51cd5d42/_9mBMgy322tocNYoS_mJy.png\"\
          ><img alt=\"image.png\" src=\"https://cdn-uploads.huggingface.co/production/uploads/63239b8370edc53f51cd5d42/_9mBMgy322tocNYoS_mJy.png\"\
          ></a></p>\n<p>Top left is OldFish 1.1. Aah, it draws the dream, but one\
          \ can't make diffusers out of it. The other 3 are my attempts to fix it,\
          \ I mean, they're all fixed versions that can be used for diffusers. But\
          \ they don't draw the same thing! Extra girls appear on the picture in different\
          \ styles. BlessedVAE is the bottom right and it loses the thread and makes\
          \ something completely different! \U0001F604 But ColorVAE makes that composition\
          \ too, so it looks it was based on Blessed2.</p>\n<p>I'll continue researching\
          \ this, hope one can day I can fix it while retaining the generated content.\
          \ Nobody does what OldFish 1.1 does, not even other OldFish versions! There\
          \ must be a way, and one day I'll find it, I hope! \U0001F606</p>\n"
