        author:
          avatarUrl: https://aeiljuispo.cloudimg.io/v7/https://cdn-uploads.huggingface.co/production/uploads/63239b8370edc53f51cd5d42/88od0k-AAkxAIV-5ULwDs.png?w=200&h=200&f=face
          fullname: Yn Tec
          isHf: false
          isPro: false
          name: Yntec
          type: user
        html: "<p>Awesome! Thanks fr the models! I'll try them now! \u2764\uFE0F\u2764\
          \uFE0F\u2764\uFE0F</p>\n<p>And... oh! I forgot to mention something very\
          \ important about OldFish 11! Please check it you:</p>\n<ul>\n<li><p>Load\
          \ Old Fish in a fresh instance and generate a picture</p>\n</li>\n<li><p>Now,\
          \ load a different model and generate a picture with the same settings</p>\n\
          </li>\n<li><p>Now, reload Old Fish and generate the first one again.</p>\n\
          </li>\n</ul>\n<p>It'll generate a different picture! Same prompt, same settings,\
          \ same seed, same everything, and a completely different picture! What Old\
          \ Fish generates depends on the previous model loaded and the previous generated\
          \ picture! That's why it can be hard to fix it, you think you have it, but\
